// ==UserScript==
// @name         Show Task Progress on Board
// @namespace    http://datainterchange.com/
// @version      0.8
// @description  Shows the progress of tasks on the sprint board
// @author       River Adams
// @include      /^https?://datainterchange\.visualstudio\.com.*
// @include      /^https?://dev\.azure\.com/datainterchange.*
// @grant        none
// @run-at       document-body
// @require      https://cdn.jsdelivr.net/npm/lodash@4.17.11/lodash.min.js#sha256-7/yoZS3548fXSRXqc/xYzjsmuW3sFKzuvOCHd06Pmps=
// @downloadURL https://update.greasyfork.org/scripts/418657/Show%20Task%20Progress%20on%20Board.user.js
// @updateURL https://update.greasyfork.org/scripts/418657/Show%20Task%20Progress%20on%20Board.meta.js
// ==/UserScript==

(function() {
    'use strict';
    let currentUser;
    let azdoApiBaseUrl;
    let theme;
    var $ = window.jQuery;

    // Save CPU cycles - throttle requests to the onPageUpdated function
    const onPageUpdatedThrottled = _.throttle(onPageUpdated, 3000, { leading: false, trailing: true });

    function onReady() {
        // Find out who is our current user. In general, we should avoid using pageData because it doesn't always get updated when moving between page-to-page in AzDO's single-page application flow. Instead, rely on the AzDO REST APIs to get information from stuff you find on the page or the URL. Some things are OK to get from pageData; e.g. stuff like the user which is available on all pages.
        const pageData = JSON.parse(document.getElementById('dataProviders').innerHTML).data;
        currentUser = pageData['ms.vss-web.page-data'].user;

        // Because of CORS, we need to make sure we're querying the same hostname for our AzDO APIs.
        azdoApiBaseUrl = `${window.location.origin}${pageData['ms.vss-tfs-web.header-action-data'].suiteHomeUrl}`;
        theme = pageData["ms.vss-web.theme-data"].requestedThemeId;

        // Call our event handler if we notice new elements being inserted into the DOM. This happens as the page is loading or updating dynamically based on user activity.
        $('body > div.full-size')[0].addEventListener('DOMNodeInserted', onPageUpdatedThrottled);
    }

    function onPageUpdated(){
        updateTasks();
        updateIcons();
    }

    function updateTasks(){
        var count = $('div.work-item').length;
        $('div.work-item').each(function(index){
            var id = $( this ).attr("id");
            var api_url = `${azdoApiBaseUrl}/_apis/wit/workItems/${id}?api=version=5.1`;
            $.ajax({
                url: api_url,
                json: true
            }).then(function(data) {
                console.log(id + data.fields["System.State"]);
                if(data.fields["System.State"] != "Done"){
                    var remainingWork = data.fields["Microsoft.VSTS.Scheduling.RemainingWork"];
                    var effort = data.fields["Microsoft.VSTS.Scheduling.Effort"];
                    var green = (100/effort) * remainingWork;
                    var greenColour = "#b8ffda";
                    var redColour = "#ffc2bf";
                    var yellowColour = "#fbffb8";
                    // If not the light theme:
                    if(theme !== "ms.vss-web.vsts-theme")
                    {
                       greenColour = "#005213";
                       redColour = "#3d0000";
                       yellowColour = "#6e5000";
                    }
                    if(isNaN(green))
                    {
                        $(`div#${id}.work-item`).css('background', `linear-gradient(to right, ${yellowColour} 0%, ${yellowColour} 100%)`);
                    }
                    else
                    {
                        $(`div#${id}.work-item`).css('background', `linear-gradient(to right, ${greenColour} ${green}%, ${greenColour} 0%, ${redColour} 0%, ${redColour} 100%)`);
                    }

                }
            });
        });

    }

    function updateIcons(){
        if($(".board-tile-content").length){
            getUncalculatedCards($(".board-tile-content")).each(function (){
                AddIconToCard($(this));
            });
        }
    }

    function AddIconToCard(card){
        // get the tasks of the card via the api
                var id = card.find(".id").text();
                var api_url = `${azdoApiBaseUrl}/_apis/wit/workItems/${id}?$expand=relations&api=version=5.1`;
                $.ajax({
                    url: api_url,
                    json: true
                }).then(function(data) {
                    var needsUpdating = !$(card).find(".Activities").length;
                    if(needsUpdating){
                        var startingOpacity = 0.15;
                        var invert;
                        // If the light theme:
                        if(theme == "ms.vss-web.vsts-theme"){
                            invert = 0;
                        }
                        else{
                            invert = 1;
                        }
                        var iconHtml = $(`<div style='padding:5px' class='Activities'><img id='${id}backend'src='data:image/png;base64,' class='attachment-preview-media' style=' display:none; max-width: 20px; filter: invert(${invert}) opacity(0.2)'><img id='${id}frontend' src='data:image/png;base64,' class='attachment-preview-media' style='    display:none; max-width: 20px;    filter: invert(${invert}) opacity(${startingOpacity});'><img id='${id}testing' src='data:image/png;base64,' style='   display:none; max-width: 20px;   filter: invert(${invert}) opacity(${startingOpacity})'><img id='${id}automation' src='data:image/png;base64,' class='attachment-preview-media' style='   display:none; max-width: 20px;    filter: invert(${invert}) opacity(${startingOpacity});'></div>`);
                        card.append(iconHtml);
                        if(data.relations !== undefined){
                            data.relations.forEach(function(relation){
                                if(relation.rel == "System.LinkTypes.Hierarchy-Forward"){
                                    $.ajax({
                                        url: relation.url,
                                        json: true
                                    }).then(function(taskData) {
                                        if(taskData.fields["System.WorkItemType"] == "Task"){
                                            // get the activity type
                                            var activityType = taskData.fields["Microsoft.VSTS.Common.Activity"];
                                            console.log(activityType);
                                            var imgId;
                                            switch(activityType){
                                                case 'Development':
                                                    imgId = `${id}backend`;
                                                    break;
                                                case 'Frontend Dev':
                                                    imgId = `${id}frontend`;
                                                    break;
                                                case 'Testing':
                                                    imgId=`${id}testing`;
                                                    break;
                                                case 'Automation':
                                                    imgId=`${id}automation`;
                                                    break;
                                            }
                                            var img = $(`#${imgId}`);
                                            img.css("display","inline");
                                            // If the item is not complete, then we should remove the opacity to indicate that there is still work to be done
                                            if(taskData.fields["System.State"] !== "Done"){
                                                img.css("filter", `invert(${invert}) opacity(1)`);
                                            }
                                        }
                                    });
                                }
                            });
                        }
                    }
                });
    }

    function filterData(data){
      return data.value.filter(function(data){
        return data.fields !== undefined && data.fields["System.BoardColumn"] !== undefined &&
            data.fields["System.BoardColumn"].oldValue !== undefined &&
            data.fields["System.BoardColumn"].newValue !== undefined &&
            (data.fields["System.BoardColumn"].oldValue.toUpperCase() === "READY FOR TEST" || data.fields["System.BoardColumn"].oldValue.toUpperCase() === "IN TEST") &&
            (data.fields["System.BoardColumn"].newValue.toUpperCase() === "READY FOR DEV" || data.fields["System.BoardColumn"].newValue.toUpperCase() === "IN DEV")
      });
    }

    function getUncalculatedCards(cards){
        return cards.filter(function(){
            // Find cards that are not currently loading and do not already have failbacks applied
            var uncalculated = !$(this).find(".Activities").length;
           return uncalculated;
        });
    };

  // Start modifying the page once the DOM is ready.
  if (document.readyState !== 'loading') {
    onReady();
  } else {
    document.addEventListener('DOMContentLoaded', onReady);
  }
})();